export default class extends React.Component {
  render() {
    return (
      <div className="Container">
        <div className="items Header" />
        <div className="items Banner" />
        <div className="items Jhurgen" />
        <div className="items Projects" />
        <div className="items Certificates" />
        <div className="items Contacts" />

        <style jsx>{`
          .items {
            height: 100%;
            width: 100%;
            border: 1px solid red;
          }
          .Container {
            background: white;
            display: grid;
            grid-template: 100px 300px 400px 400px 400px 150px / (minmax(200px,400px);
            grid-gap: 10px 0px;

            grid-template-areas:
              "Header         Header          Header"
              "Banner         Banner          Banner"
              "Jhurgen        Jhurgen         Jhurgen"
              "Projects       Projects        Projects"
              "Certificates   Certificates    Certificates"
              "Contacts       Contacts        Contacts";
          }
          .Header {
            grid-area: Header;
            background: Blue;
          }
          .Banner {
            grid-area: Banner;
          }
          .Jhurgen {
            grid-area: Jhurgen;
          }
          .Projects {
            grid-area: Projects;
          }
          .Certificates {
            grid-area: Certificates;
          }
          .Contacts {
            grid-area: Contacts;
          }
        `}</style>
      </div>
    );
  }
}
